//          REDIRECT REACT-ROUTE PROPERTY       \\

/*
            DEFINE REDIRECT :
               The instance of redirecting URL from one address (That may be wrong) to another defined ULR .
                With the help of React Route there is a techinique to dinamically redirect a Url adress to defined Adress .
                    * Mostly is is use to Redirect the wrong URL to a correct existed Page , so the Page Not Found technique is not used.
*/


// Importing Required Modules :
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'

// Importing Main Component :
import App from './App';

// Rendering : 
ReactDOM.render(
    <>
        <BrowserRouter>
            <App />
        </BrowserRouter>
    </>, document.getElementById('root')
);



                //                END                 \\
